import { ApolloServer, gql } from 'apollo-server';

const typeDefs = gql`
    type Movie {
        id: Int
        title: String
        yaer: Int
    }

    type Query {
        movies: [Movie],
        movie: Movie
    }

`;

const resolvers = {
	Query: {
		movies: () => () => [],
		movie: () => () => [],
	},
	Mutation: {
		createMovie: (_, {title, year}) => {
			console.log(title, year);
			return true
		},
		deleteMovie: (_, {title, year}) => {
			console.log(year, title);
			return true
		},
	}
}


const server = new ApolloServer({
	typeDefs,
	resolvers
})

server.listen().then(()=> console.log('server is running :http://localhost:4000'))
